/**
 * @param {number[]} nums
 * @return {number}
 */
var minGroupsForValidAssignment = function(nums) {
    nums.sort((a, b) => a - b);
    let groups = 0;
    let freq = new Map();

    for (let num of nums) {
        if (freq.has(num - 1)) {
            let prevCount = freq.get(num - 1);
            if (prevCount === 1) {
                freq.delete(num - 1);
            } else {
                freq.set(num - 1, prevCount - 1);
            }
            freq.set(num, (freq.get(num) || 0) + 1);
        } else {
            groups++;
            freq.set(num, (freq.get(num) || 0) + 1);
        }
    }

    return groups;
};
